(246, 'The price hike for pork meat will surely increase ', 'For today\'s news: April 1, 2023\r\nThe price hike for pork meat will surely increase this coming holy week. \r\nThe demand for pork meat will be higher also after fasting from meat. According to the Department of Agriculture during fasting, the demand somehow will be reduced during the season.\r\n\r\n\r\nImage Courtesy from inquire.net.\r\n\r\nFor the Assistant of Agriculture Secretary Rex Estoperez, retailers have from the suppliers that informed of an increase of 5 pesos. The price increase remains the biggest problem for the government.\r\n\r\nThe reason for the price increase because  production from the piggery farm with the active case of African Swine Fever is also a serious challenge in the industry.\r\n', 'News', 'Sat, Apr 17, 2023, 10:45 PM', '<p>For today\'s news: April 1, 2023</p><h2>The price hike for pork meat will surely increase this coming holy week. </h2><p>The demand for pork meat will be higher also after fasting from meat. According to the Department of Agriculture during fasting, the demand somehow will be reduced during the season.</p><p><br></p><p><img src=\"https://newsinfo.inquirer.net/files/2023/03/452094.jpeg\"></p><p><em>Image Courtesy from inquire.net.</em></p><p><br></p><p>For the Assistant of Agriculture Secretary Rex Estoperez, retailers have from the suppliers that informed of an increase of 5 pesos. The price increase remains the biggest problem for the government.</p><p><br></p><p>The reason for the price increase because  production from the piggery farm with the active case of African Swine Fever is also a serious challenge in the industry.</p>', 'Approved', 'good', 'Approved', 'Romeo Angelo Ignacio', 202302, 'main', 0x433a2f78616d70702f6874646f63732f7468657369732f7372632f6e657773496d6167652f496e7374616772616d20506f737420e2809320312e706e67, 39.42, 'positive', 'true', 0, 'Pork Price ', 'Sat, Apr 1, 2023, 10:45 PM', 75, '', ''),
