(252, 'Arduino Pro', 'The Arduino Pro Nicla Vision features a 2MP color camera and the intelligence to process and extract useful information from anything it sees. Discover how this tiny board can unlock the massive potential o\r\n', 'Technologies', 'Thu, Apr 20, 2023, 9:31 PM', '<p>The Arduino Pro Nicla Vision features a 2MP color camera and the intelligence to process and extract useful information from anything it sees. Discover how this tiny board can unlock the massive potential o</p>', 'Approved', 'good', 'Approved', 'Romeo Angelo Ignacio', 202302, 'Sources', 0x433a2f78616d70702f6874646f63732f7468657369732f7372632f6e657773496d6167652f3332323436363132335f3731383230323739323931383332375f323337393036323233323739343137393430385f6e2e6a7067, 39.53, 'positive', 'false', 0, 'Arduino Pro', 'Mon, Apr 24, 2023, 1:49 PM', 12, 'http://localhost:3000/story/ Arduino Pro', ''),
(253, 'NBA: GOLDEN WARRIORS VS SACRAMENTO KINGS', 'At least 86 Filipinos have asked for rescue or deportation after violent clashes between Sudanese troops and paramilitaries in Khartoum, the Foreign Ministry (EDA) said on Thursday.\r\n\r\nFDFA Undersecretary Eduardo de Vega said 39 Filipinos applied for repatriation and another 47 for relocation.\r\n\r\n“The numbers will increase. It could be different by tomorrow. We currently estimate only about 100.We\'re getting ready for a hundred,\" he told INQUIRER.net over the phone.\r\n\r\nDe Vega said the FDFA would prefer that all Filipinos return to the Philippines from Sudan because \"it\'s not a very stable situation compared to other countries\".\r\nDFA\r\nspokeswoman Teresita Daza told reporters in a text message that \"there have been no confirmed injuries or deaths in the Filipino community.\"\r\n\r\n\r\nHe added that they are also in talks with the Philippine Honorary Consulate in Khartoum and the Philippine Embassy in Cairo to use their Citizen Relief Fund to \"facilitate evacuation and provide humanitarian assistance to Filipinos\" in the besieged country.\r\n', 'Sport', 'Sat, May 6, 2023, 12:49 AM', '<p>At least 86 Filipinos have&nbsp;asked&nbsp;for&nbsp;rescue&nbsp;or&nbsp;deportation&nbsp;after&nbsp;violent&nbsp;clashes between Sudanese troops and&nbsp;paramilitaries&nbsp;in Khartoum, the Foreign&nbsp;Ministry&nbsp;(EDA)&nbsp;said&nbsp;on&nbsp;Thursday.</p><p><br></p><p>FDFA&nbsp;Undersecretary Eduardo de Vega said 39 Filipinos&nbsp;applied&nbsp;for&nbsp;repatriation&nbsp;and&nbsp;another&nbsp;47&nbsp;for&nbsp;relocation.</p><p><br></p><p>“The numbers will&nbsp;increase.&nbsp;It&nbsp;could&nbsp;be&nbsp;different&nbsp;by&nbsp;tomorrow.&nbsp;We&nbsp;currently&nbsp;estimate&nbsp;only&nbsp;about&nbsp;100.We\'re&nbsp;getting&nbsp;ready&nbsp;for a&nbsp;hundred,\"&nbsp;he told INQUIRER.net over the phone.</p><p><br></p><p>De Vega said the&nbsp;FDFA&nbsp;would prefer&nbsp;that&nbsp;all Filipinos return to the Philippines&nbsp;from&nbsp;Sudan&nbsp;because&nbsp;\"it\'s&nbsp;not a very stable situation compared to other&nbsp;countries\".</p><p>DFA</p><p>spokeswoman&nbsp;Teresita Daza told reporters in a text message that&nbsp;\"there&nbsp;have&nbsp;been&nbsp;no&nbsp;confirmed&nbsp;injuries&nbsp;or&nbsp;deaths&nbsp;in&nbsp;the Filipino&nbsp;community.\"</p><p><br></p><p><br></p><p>He&nbsp;added&nbsp;that&nbsp;they&nbsp;are also in talks with the Philippine Honorary Consulate in Khartoum and the Philippine Embassy in Cairo to&nbsp;use&nbsp;their&nbsp;Citizen&nbsp;Relief&nbsp;Fund&nbsp;to&nbsp;\"facilitate&nbsp;evacuation and provide&nbsp;humanitarian&nbsp;assistance&nbsp;to&nbsp;Filipinos\"&nbsp;in the&nbsp;besieged&nbsp;country.</p>', 'Approved', 'good', 'Approved', 'Romeo Angelo Ignacio', 202302, 'Sources', 0x433a2f78616d70702f6874646f63732f7468657369732f7372632f6e657773496d6167652f3332323436363132335f3731383230323739323931383332375f323337393036323233323739343137393430385f6e2e6a7067, 90, 'positive', 'true', 0, 'NBA: GOLDEN WARRIORS VS SACRAMENTO KINGS', 'Sat, May 6, 2023, 8:17 PM', 24, 'http://localhost:3000/story/NBA: golden waRRIORS VS Sacramento Kings', 'Mark Angelo Fariñas Ignacio');
